import { Navigate, Route, Routes } from "react-router-dom";
import MainPage from "./pages/mainPage";

function App() {
  return (
    <>
      <Routes>
        <Route path="/products" element={<MainPage />} />
        <Route path="*" element={<Navigate to={"/products"} />} />
      </Routes>
    </>
  );
}

export default App;
